import React from "react";
import Cards from './Cards'
import Sdata from "./Sdata";

const favSeries = 'netflix';

const FavSer = () => {
    if (favSeries = 'netflix') {
        <Cards
            key={Sdata[1].id}
            imgsrc={Sdata[1].imgsrc}
            title={Sdata[1].title}
            seriesName={Sdata[1].seriesName}
            link={Sdata[1].link}
        />
    }

}


const App = () => (
    <>
        <h1 className="heading_style">List of top 5 movies in 2020 to watch</h1>

        {Sdata.map((val, index) => {
            return (
                <FavSer/>
            );
        })};
    </>
);

export default App;
